import { jsPDF } from "jspdf";
import mysql from "mysql2/promise";

const thSarabunFontBase64 = `

`;



export default async function handler(req, res) {
  const { id } = req.query;

  // 
  const db = await mysql.createConnection({
    host: "localhost",
    user: "root",
    password: "",
    database: "hrd",
  });
  try {
    // 
    const [rows] = await db.execute(
      `
      SELECT 
        tr.*, 
        u.first_name, 
        u.last_name, 
        u.email, 
        u.phone_number, 
        u.position, 
        u.level, 
        u.department,
        u.group_name
      FROM 
        training_reports AS tr
      JOIN 
        users AS u
      ON 
        tr.username = u.username
      WHERE 
        tr.id = ?;
      `,
      [id]
    );

    // 
    if (rows.length === 0) {
      return res.status(404).json({ error: "Data not found" });
    }

    const data = rows[0];

    //  PDF
    const doc = new jsPDF();

    // 
    doc.addFileToVFS("THSarabun.ttf", thSarabunFontBase64);
    doc.addFont("THSarabun.ttf", "THSarabun", "normal");
    doc.setFont("THSarabun");


doc.setFontSize(16);
doc.text(`: ${data.id}`, 105, 10, { align: 'center' });  // 
doc.setFontSize(14);
doc.text(":", 70, 20, { align: 'center' });

//  ( 2-3 )
doc.setFontSize(12);
doc.text(`-: ${data.first_name} ${data.last_name}`, 10, 30);
doc.text(`: ${data.phone_number}`, 100, 30);
doc.text(`: ${data.position}${data.level}`, 10, 40);
doc.text(`: ${data.email}`, 100, 40);
doc.text(`//: ${data.department}`, 10, 50);
doc.text(`/: ${data.group_name}`, 100, 50);

//  ( 2-3 )
doc.setFontSize(14);
doc.text(":", 70, 60, { align: 'center' });
doc.setFontSize(12);

//    
doc.text(`: ${data.trainingOrg || "N/A"}`, 10, 70);  // 
doc.text(`: ${data.courseCode || "N/A"}`, 10, 80);  // 

//    
doc.text(`: ${data.category || "N/A"}   : ${data.trainingMethod || "N/A"}   : ${data.hybridLocation || "N/A"}`, 10, 90);

//    
doc.text(`: ${data.startDate || "N/A"}`, 10, 100);  
doc.text(`: ${data.endDate || "N/A"}`, 10, 110);

//  ( 2-3 )
doc.setFontSize(14);
doc.text(":", 70, 120, { align: 'center' });
doc.setFontSize(12);
doc.text(`: ${data.regFeeAmount || "N/A"} `, 10, 130);
doc.text(`: ${data.accommodationFeeAmount || "N/A"} `, 100, 130);
doc.text(`: ${data.transportationFeeAmount || "N/A"} `, 10, 140);
doc.text(`: ${data.allowanceFeeAmount || "N/A"} `, 100, 140);
doc.text(`: ${data.totalCost || "N/A"} `, 100, 150);
doc.text(`: ${data.internalBudget || "N/A"} `, 10, 160);
doc.text(`${data.externalAgency || "N/A"}: ${data.externalBudget || "N/A"} `, 100, 160);

//  ( 2-3 )
doc.setFontSize(14);
doc.text(":", 70, 170, { align: 'center' });
doc.setFontSize(12);
doc.text(`: ${data.planBudget || "N/A"}`, 10, 180);
doc.text(`/: ${data.projectOutput || "N/A"}`, 100, 180);
doc.text(`: ${data.mainActivity || "N/A"}`, 10, 190);
doc.text(`: ${data.subActivity || "N/A"}`, 100, 190);

//  ( 2-3 )
doc.setFontSize(14);
doc.text(":", 70, 200, { align: 'center' });
doc.setFontSize(12);
doc.text(`1. /: ${data.knowledgeSelfDevelop || "N/A"}`, 10, 210);
doc.text(`2. ///: ${data.knowledgeWorkImprove || "N/A"}`, 10, 220);
doc.text(`3. : ${data.knowledgeTeamwork || "N/A"}`, 10, 230);
doc.text(`4. : ${data.knowledgeEfficiency || "N/A"}`, 10, 240);
doc.text(`5. : ${data.knowledgeNetworking || "N/A"}`, 10, 250);



    //  PDF 
    const pdf = doc.output("arraybuffer");
    res.setHeader("Content-Type", "application/pdf");
    res.send(Buffer.from(pdf));
  } catch (error) {
    console.error(error);
    res.status(500).json({ error: "Internal server error" });
  } finally {
    // 
    await db.end();
  }
}